import React from "react";
import Button from "@mui/material/Button";

export default function ControlCard({ title }) {
  const alertStart = () => {
    window.alert("คุณกำลังกด Start " + title);
  };
  const alertRestart = () => {
    window.alert("คุณกำลังกด Restart " + title);
  };
  const alertDown = () => {
    window.alert("คุณกำลังกด Down " + title);
  };
  const showData = () => {
    return (
      <div>
        <li>Hello</li>
        <li>World</li>
      </div>
    );
  };

  return (
    <div>
      <h1 class="bg-green-700"> {title} </h1>
      <Button className="bg-green-500" onClick={() => alertStart()}>
        Start
      </Button>

      <Button color="secondary">Secondary</Button>
      <Button variant="outlined" color="error">
        Error
      </Button>
      <Button variant="contained" color="success">
        Success
      </Button>
      {showData()}
    </div>
  );
}
